<template>
  <div class="fixed-center">
        <form action="a" @submit.prevent='login'>
        <q-card style="min-width: 200px">
            <q-img
              src="data:image/jpeg;base64,"
              :ratio="4/3"
            />
        </q-card>
        <q-card style="min-width: 300px">
            <q-card-section>
                <div class="q-pa-md flex flex-center text-h6">Iniciar Sesion</div>
            </q-card-section>
            <q-card-section class="q-gutter-xl">
                <q-form @submit="login">
                    <q-input
                        label="Ingrese su correo electronico"
                        v-model="username"
                        :rules="[val => val !== null && val !== '' || 'Por favor ingrese nombre de usuario.']"
                    />
                    <q-input
                        label="Contraseña"
                        v-model="password"
                        type="password"
                        :rules="[val => val !== null && val !== '' || 'Por favor ingrese contraseña.']"
                    />
                    <!-- Boton para olvido de contraseña-->
                    <forgot-password/>
                    <div class="q-pa-md flex flex-center">
                      <div class="q-pa-sm">
                        <q-btn type="submit" label="Iniciar sesion"/>
                      </div>
                      <div class="q-pa-sm">
                        <q-btn label='Registrarse' @click="register"/>
                      </div>
                    </div>
                </q-form>
            </q-card-section>
        </q-card>
        </form>
    </div>

</template>

<style>
</style>

<script>
import router from '@/router'
import ForgotPassword from '@/components/ForgotPassword'
export default {
  name: 'Login',
  components:{
    ForgotPassword
  },
  data() {
    return {
      username: '',
      password: '',
      response: [],
    }
  },
  methods: {
    async login() {
      this.$q.loading.show({ delay: 400 })
      const email = this.username
      const password = this.password
      const post = this.$http.post

      await post(
        '/client/login',
        {
          email: email,
          password: password
        }
      ).then(results => {
        this.response = results.data
      }).catch(error => {
        console.log(error)
      })

      if(this.response.length > 0){
        this.$user.id = this.response[0].usuarioid
        this.$user.name = this.response[0].nombrecompleto
        this.$user.email = this.response[0].email
        this.$user.age = this.response[0].edad
        router.push({name: 'Home'})

      } else {
        this.$q.notify({ color: 'negative', message: 'Usuario o contraseña no coinciden', icon: 'report_problem' })
      }
      this.$q.loading.hide()
    },
    register() {
      router.push({name: 'Register'})
    }
  }
  }
</script>
